enum.comment:
FDD specific comment: Selects a working mode for UL power control. Offers various combinations between open-loop and closed-loop control for PUCCH and PUSCH/SRS power.
values: 
PuschOLPucchOL: PUSCH open loop, PUCCH open loop;
PuschOLPucchCL: PUSCH open loop, PUCCH closed loop;
PuschCLPucchOL: PUSCH closed loop, PUCCH open loop;
PuschCLPucchCL: PUSCH closed loop, PUCCH closed loop;
PuschCLSrsPucchOL: PUSCH closed loop with SRS input, PUCCH open loop; PuschCLSrsPucchCL: PUSCH closed loop with SRS input, PUCCH closed loop; PuschIAwPucchOL: PUSCH interference-aware, PUCCH open loop;
PuschIAwPucchCL: PUSCH interference-aware, PUCCH closed loop.

TDD specific comment: Selects a working mode for UL power control. Offers various combinations between open-loop and closed-loop control for PUCCH and PUSCH/SRS power.

Antenna technology:
0: voice; 
1: data; 
2: voice/data
